import classes from "./FoodItem.module.scss"
function FoodItem() {
    return (
        <div className={classes.wrapper}>
            <img className={classes['food-image']} src="" alt="food" />
            <p className={classes['food-name']}>Món 1</p>
        </div>
    );
}

export default FoodItem;

